import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as r,f as d}from"./app-458147e9.js";const h={},i=d('<p>过去的一年有变化吗？</p><h2 id="技术成长、职业发展" tabindex="-1"><a class="header-anchor" href="#技术成长、职业发展" aria-hidden="true">#</a> 技术成长、职业发展</h2><p>和年初相比，技术几乎没有进步，只是增加了一年的开发经验和沟通经验罢了</p><p>对社区毫无贡献，一些基本的原理并没有舍得发时间去深钻</p><p>精神内耗严重，总是陷入离职和躺平的纠结当中</p><p>明年想看完《程序员修炼之道》</p><h2 id="生活" tabindex="-1"><a class="header-anchor" href="#生活" aria-hidden="true">#</a> 生活</h2><p>今年比上年更喜欢出门了，经常会选择在双休日中选择一天出门走走，而不是一味的宅在家里</p><p>出门多了，发现周围好玩的事情太多，时间太少，每一周都过的很快</p><h2 id="装备" tabindex="-1"><a class="header-anchor" href="#装备" aria-hidden="true">#</a> 装备</h2><h3 id="显示器" tabindex="-1"><a class="header-anchor" href="#显示器" aria-hidden="true">#</a> 显示器</h3><p>赶上双十二的末班车，购置了一台 4K 显示器（红米 27寸 4k）</p><p>之前一直觉得 2k 开启 hidpi 之后应该也差不多，但是实际入手之后发现效果还是差了挺多的，后悔没有早点下决心</p><h3 id="耳机" tabindex="-1"><a class="header-anchor" href="#耳机" aria-hidden="true">#</a> 耳机</h3><p>对象送了一个全包的降噪耳机，虽然我嫌弃不够方便，但是看电影的时候戴着还是很舒服</p><h2 id="软件" tabindex="-1"><a class="header-anchor" href="#软件" aria-hidden="true">#</a> 软件</h2><h3 id="obsidian" tabindex="-1"><a class="header-anchor" href="#obsidian" aria-hidden="true">#</a> Obsidian</h3><p>首先我没有用到<strong>双链</strong>功能，我只是拿来当一个纯粹的 Markdown 写作工具，所有插件都是为了提高写作效率</p><p>其次，国内的云笔记平台有些让人失望，从语雀切换切换到 Obsidian 之后，对自己笔记的安全都放心不少</p><h3 id="utools" tabindex="-1"><a class="header-anchor" href="#utools" aria-hidden="true">#</a> uTools</h3><p>这个只适用于开发者</p><p>体验过 Alfred、raycast、uTools，最后还是 uTools 这个国产工具集符合使用习惯</p><p>剪切板、Json工具等都帮我节省了不少时间</p>',23),n=[i];function s(o,t){return e(),r("div",null,n)}const l=a(h,[["render",s],["__file","221225_2022年终总结.html.vue"]]);export{l as default};
